import React from "react";

class App extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      main: "Main",
      servise: "Servise",
      forAs: "For as",
      contact: "Contact",
    };
  }
  render() {
    return (
      <div>
        <header>
          <div>{this.main}</div>
          <div>{this.servise}</div>
          <div>{this.forAs}</div>
          <div>{this.contact}</div>
        </header>
      </div>
    );
  }
}
export default App;
